/**
 * @file    circles.h
 * @brief   Animation exhibiting arrangements of 4 circles in affine plane.
 *
 * Functions to animate between all 173 distinct arrangements of 4 circles in
 * the affine plane. Two circles must either be disjoint or meet in two points;
 * three circles may not meet at a point.
 *
 * Arrangements are disjoint if neither can be continuously deformed into the
 * other, while:
 *  - keeping circles circular (changing radii is allowed)
 *  - preserving multiplicity of intersection points
 *  - not allowing any circle to cross an intersection point
 *  - optionally reflecting about a line
 *
 * For more information about the problem, see sequence A250001 in the OEIS.
 *
 * @author  D. Trinchero (dario.trinchero@pm.me)
 * @date    2020-05-31
 */

